import React from "react";
import ppic from "./asset/Layer 2.png"
import Jessicadata from "./jessicadata"


function profile() {
  return (
    <div className=" mt-[30px] w-[367px] max-h-[680px] bg-white rounded-[16px] opacity-100  p-4">
      {/* Profile Picture */}
      <div className=" mx-[75px] my-[20px] w-[200px] h-[200px] bg-transparent">
        <img
          src={ppic}
          alt="Profile"
          className="w-full h-full object-cover"
        />
      </div>

      {/* Profile Name */}
      <div className="  w-[164px] h-[33px] mx-[95px] my-[32px] text-center font-manrope font-extrabold text-[24px] leading-[33px] text-[#072635]">
        Jessica Taylor
      </div>

      {/* Icon and Date of Birth */}
      {Jessicadata.map((jes, index) => (
  <div key={index} className="mt-[24px] space-y-4 mx-[5px]">
    <div className="flex items-center">
      <img src={jes.img} alt="Icon" className="w-[42px] h-[42px] mr-[10px] " />
      <div className="flex flex-col">
        <p className="text-[14px] text-gray-600">{jes.inputname}</p>
        <p className="text-[14px] font-manrope font-extrabold text-gray-600">{jes.inputval}</p>
      </div>
    </div>
  </div>
))};

      {/* Button */}
      <div className=" mx-[80px] my-[20px]  ">
        <button className="bg-blue-500 text-white px-4 py-2 rounded-lg">
          Show Information
        </button>
      </div>
    </div>
  );
}
export default profile;
